import React,{ useState, useRef} from 'react';


function AddFeedback(){
	const [feed, setFeed] = useState('');
	return(
		<div className='AddFeedback'>
			<textarea onChange={e=>{setFeed(e.target.value)}}></textarea>

		</div>
	);
}

export default AddFeedback;
